	"nome" : "PCR EM TEMPO REAL",
	"descricao" : "A tcnica de PCR em tempo real, abreviao de 'Polymerase Chain Reaction' (Reao em Cadeia da Polimerase) em tempo real,  uma poderosa ferramenta da biologia molecular utilizada para amplificar, quantificar e monitorar a replicao de sequncias de DNA em tempo real. Ela  frequentemente referida como qPCR (Quantitative PCR) devido  sua capacidade de fornecer resultados quantitativos, ou seja, a capacidade de medir a quantidade exata de DNA amplificado durante a reao em cadeia da polimerase. O PCR em tempo real  amplamente utilizado em vrias aplicaes, incluindo: Biologia Molecular e Gentica:  usado para a quantificao de expresso gnica, anlise de mutaes genticas, estudos de variantes genticas, diagnstico de doenas genticas, entre outros. Microbiologia:  aplicado na deteco e quantificao de microrganismos, incluindo vrus, bactrias e fungos, em amostras clnicas, ambientais e alimentares. Medicina Diagnstica:  utilizado em testes de diagnstico molecular para doenas infecciosas, cncer, doenas genticas, entre outras condies. Ecologia e Estudos Ambientais:  usado para monitorar a presena e a quantidade de espcies especficas em amostras ambientais. O PCR em tempo real utiliza uma mquina chamada termociclador em tempo real que aquece e esfria a reao em ciclos, permitindo a amplificao das sequncias de DNA. Durante a reao, so utilizadas sondas ou corantes fluorescentes que se ligam ao DNA amplificado.  medida que o DNA se replica, a intensidade do sinal fluorescente aumenta em proporo  quantidade de DNA gerada. Esse sinal  capturado pelo termociclador em tempo real e traduzido em tempo real para uma curva de amplificao, que  uma representao grfica do aumento da quantidade de DNA ao longo do tempo. A principal vantagem do PCR em tempo real  a sua capacidade de fornecer resultados quantitativos e sensveis em tempo real, o que o torna uma ferramenta essencial em laboratrios de pesquisa, diagnstico clnico e em muitas outras reas. Ele  amplamente utilizado para quantificar e monitorar a presena de material gentico em vrias aplicaes."
