	"nome" : "PLASMA CITRATADO CONGELADO",
	"descricao" : "O plasma citratado congelado  um componente sanguneo que  obtido a partir do plasma sanguneo de um doador.  chamado de 'citratado' porque contm citrato de sdio, que  um anticoagulante que impede a coagulao do plasma. O citrato  adicionado durante a coleta do sangue para evitar que o sangue se coagule e permitir que o plasma seja separado das clulas sanguneas. Depois que o plasma  separado, ele pode ser congelado para preservar suas propriedades e componentes por um perodo prolongado. O plasma citratado congelado  frequentemente utilizado para vrias finalidades mdicas, incluindo: Transfuses de componentes sanguneos: O plasma pode ser transfundido a pacientes que precisam de fatores de coagulao especficos, como em casos de distrbios de coagulao ou cirurgias. Produo de hemoderivados: O plasma  uma matria-prima importante na produo de diversos produtos de terapia plasmtica, como o fator de coagulao e a albumina. Pesquisa mdica: O plasma  frequentemente usado em estudos e pesquisas mdicas para entender melhor as propriedades do sangue e desenvolver tratamentos mdicos.  importante notar que o plasma citratado congelado  armazenado em condies controladas e deve ser manipulado e transportado de forma adequada para preservar sua qualidade e garantir sua segurana para uso mdico. Alm disso, a doao de plasma  uma parte importante da doao de sangue e ajuda a salvar vidas em vrias situaes clnicas."
